For tags starting with op, see "op*":[/tags?commit=Search&search%5Bhide_empty%5D=yes&search%5Bis_deprecated%5D=no&search%5Bname_or_alias_matches%5D=op%2A&search%5Border%5D=count] or "op_*":[/tags?commit=Search&search%5Bhide_empty%5D=yes&search%5Bis_deprecated%5D=no&search%5Bname_or_alias_matches%5D=op_%2A&search%5Border%5D=count];

Any non-English text (usually Japanese, Chinese, or Korean) within an image that needs a translation into English. [[Audible speech]] that is not in English and does not have hardcoded English subtitles in the video may use this tag. Do not use this tag for untranslated [[help:artist commentary|artist commentaries]], see [[commentary request]] instead.

[b]Please read [[howto:translate]] for guidelines on translation[/b]. When the post is fully translated, remove the [[translation request]] tag and add [[translated]]. If the translation is incomplete or needs review, leave the [[translation request]] tag and add the [[partially translated]] or [[check translation]] tags.

For text that is very difficult to translate due to visual or language difficulties, consider also adding it to pool #11363: Translation Request - LUNATIC Mode.

When the untranslated text is not Japanese, additionally tag it with the appropriate language.

